INSERT INTO `deck_comments` VALUES (1,122,148,'(Auron)[1-002-R] can be replaced by (Jecht)[1-015-L], Potential cuts are Sylph, Zack and Firion in that order.','2016-11-15 13:40:18','2016-11-15 13:40:18',NULL),(2,135,1,'Haha great description ;)','2016-11-15 13:53:29','2016-11-15 13:53:29',NULL),(13,139,68,'Deck seems solid however why are you not playing Yaag Rosch? Your Yuna and Minwu are sitting ducks.','2016-11-15 17:33:02','2016-11-15 17:33:02',NULL),(17,139,224,'I do like Yaag, but the dream is to have Minwu, Yuna, Maria, Aerith, Chaos on the board and he takes up a vital slot. I run 3 of each card to replace it if it gets broken. Water has a lot of cycle and you\'d be amazed how quick you go through the deck','2016-11-15 20:32:01','2016-11-15 20:32:01',NULL),(19,156,4,'Definitely a high-risk deck but I like it!','2016-11-15 22:48:11','2016-11-15 22:48:11',NULL),(20,163,242,'Great deck, I love it! So much synergy between the cards! Moogle seems weak though?','2016-11-16 02:06:28','2016-11-16 02:06:28',NULL),(21,174,240,'Have you tested it in a real game? 19 summons seems super high to me.','2016-11-16 03:23:09','2016-11-16 03:23:09',NULL),(22,174,245,'So far the deck is undefeated @Nikoenig :)','2016-11-16 03:47:17','2016-11-16 03:47:17',NULL),(25,174,240,'@Kazhik undefeated, really? That\'s great! GG\r\nwhen you need to discard cards to generate CPs, do you discard summons first?','2016-11-16 05:56:59','2016-11-16 05:56:59',NULL),(26,132,250,'Isn\'t one copy of (Wedge) [1-203-S] the same as adding a third copy of (Biggs) [1-206-S]? Or is this meant to free up space and get more Cloud cards when you draw?','2016-11-16 06:02:00','2016-11-16 06:02:00',NULL),(28,176,259,'What purpose is 3 x (Onion Knight) [1-181-H] serving here?','2016-11-16 11:53:27','2016-11-16 11:53:27',NULL),(32,123,259,'Sooo similar to my main deck, it\'s uncanny! I love it!','2016-11-16 12:03:15','2016-11-16 12:03:15',NULL),(33,191,260,'1-216-S Wakka as alternative (->Yuffie?)\r\n1-074-R Sylph as alternative (-> Moogle?)\r\n1-198-S Valefor as alternative (-> Moogle?)','2016-11-16 13:48:33','2016-11-16 13:48:33',NULL),(34,191,260,'(Wakka) [1-216-S] instead (Yuffie) [1-086-C]?','2016-11-16 13:49:37','2016-11-16 13:49:37',NULL),(35,191,260,'(Sylph) [1-074-R] instead(Moogle) [1-172-C]?','2016-11-16 13:50:29','2016-11-16 13:50:29',NULL),(36,191,260,'(Valefor) [1-198-S] instead(Moogle) [1-172-C]','2016-11-16 13:50:50','2016-11-16 13:50:50',NULL),(37,132,215,'Correct, the Wedge is included for deck thinning as you suggested.','2016-11-16 14:48:23','2016-11-16 14:48:23',NULL),(38,171,139,'is there a better replacement squall? i mean half his effects need laguna whos not even here :S','2016-11-16 19:06:43','2016-11-16 19:06:43',NULL),(40,176,240,'@Blastyboy because you can discard him for any color and he\'s a haste for 2 generic CPs, that\'s crazy good when you\'ve dulled or killed off the opponent\'s field','2016-11-16 22:07:16','2016-11-16 22:07:16',NULL);
