l control','',0,'2016-11-06 13:23:48','2016-11-06 13:23:48',NULL),(37,91,'FreeZidane','',0,'2016-11-06 15:37:18','2016-11-06 15:37:18',NULL),(38,91,'3 Type Knight','',0,'2016-11-06 15:59:04','2016-11-06 15:59:04',NULL),(39,93,'Zidane unblockable','Aggression  plus high Ex',0,'2016-11-06 19:42:02','2016-11-06 19:42:02',NULL),(40,93,'Cheap X combo','X deck with cheap cards',0,'2016-11-06 20:06:30','2016-11-06 20:06:30',NULL),(41,51,'Fire/Lightning','',1,'2016-11-06 20:22:31','2016-11-06 20:22:31',NULL),(42,93,'Field control - Earth/Ice','Abusing Emperor and Vanille',0,'2016-11-06 20:39:40','2016-11-06 20:39:40',NULL),(43,93,'EX mayhem','40 EX cards, are you mad bro',0,'2016-11-06 21:03:13','2016-11-06 21:03:13',NULL),(44,69,'Combat tricks','',0,'2016-11-06 23:12:22','2016-11-06 23:12:22',NULL),(45,69,'FFX','',0,'2016-11-06 23:24:00','2016-11-06 23:24:00',NULL),(46,95,'FF VII Fire/Wind Aggro','Weenie Rush at its finest. Most of your units have conditions where they are unblockable. First Strike Units coupled with Summons and Tifa and Yuffie\'s Limits can take out large blockers. Which means that most opponents will feel discouraged from blocking.  \r\n\r\nThis deck also has a high probability of getting in for damage on turn 1 due to the Tifa and Onion Knights. \r\n\r\nBrynhildr is difficult to play from hand with this deck due to the low backup number.. Bahamut Fury would be more versatile. However, on EX damage Brynhilder is much better.\r\n\r\nThis deck is light on 4 drops and runs no 5 drops because we can\'t afford the cards. You should rarely discard 2 cards for a character. \r\n\r\nFirion is in the deck primarily to help against other aggressive plans while also providing a reasonable body. Firion and Cloud can also be used to setup trades or discourage blocking because in many cases they can pump our First Strike characters by 4000 or 2000 respectively.\r\n\r\nParty attacking with Zidane or Yufie + an Archer tends to be fairly strong because the combination often prevents larger units from blocking and First strike can kill many smaller ones.\r\n\r\nCards I would like to find room for.\r\n\r\nGadot- Gadot is basically a 0 drop as it lets you play Red XIII, Tifa, or Cloud for 0. This makes him an insane play at many points in the game.\r\n\r\nBahamut Fury-The flexibility of this card is great as the difference between 2 cost and 3 cost with Brynhilder is significant. I think it is rarely correct to discard a card to play a summon unless they have an extremely valuable unit in play. Also, most of these valuable units are 8000+ so it does not kill them out right on EX. Neither does Bahamut Fury, but Fury is cheaper to play with a First Strike character.',1,'2016-11-06 23:25:03','2016-11-07 18:46:27',NULL),(47,69,'Take the hit','',0,'2016-11-06 23:34:05','2016-11-06 23:34:05',NULL),(48,96,'FF VII','',1,'2016-11-06 23:42:42','2016-11-06 23:42:42',NULL),(49,95,'Delete','',0,'2016-11-06 23:44:14','2016-11-08 03:20:34',NULL),(50,48,'','',0,'2016-11-07 00:00:54','2016-11-09 03:12:05','2016-11-09 03:12:05'),(51,96,'Gilgamesh','',1,'2016-11-07 00:13:37','2016-11-07 23:37:03',NULL),(52,72,'Cruel Control V2','My Cruel Control Build',1,'2016-11-07 03:18:46','2016-11-07 03:18:46',NULL),(53,48,'Eclair','Lightning. It flashes bright, then fades away. It can\'t protect. It only destroys.',0,'2016-11-07 04:20:53','2016-11-10 04:16:18',NULL),(54,100,'Fire // Ice','',0,'2016-11-07 10:56:12','2016-11-07 10:56:12',NULL),(55,56,'Ice-Lightning-Dull','',0,'2016-11-07 11:41:07','2016-11-07 11:41:07',NULL),(56,103,'Control deck','Simple Thunder/Frost control deck which is still in early stages, only a handful of rarer cards. I will slowly tweak it as I get better cards but it does its job well. Need some lulus ',1,'2016-11-07 12:07:38','2016-11-07 12:07:38',NULL),(57,29,'Tidus Combo','',0,'2016-11-07 13:27:58','2016-11-07 13:27:58',NULL),(58,100,'Waterpark Magikarp','Water stuff does stuff, which is helpful when the wind stuff does stuff too.',0,'20