est','test',0,'2016-11-11 12:48:58','2016-11-11 12:48:58',NULL),(110,127,'Zidane Tidus','Uses Zidane and Yuffie deal some combat points, YuRiPa as mid play combo, and Tidus Blitz Ace as finisher.',1,'2016-11-11 13:42:56','2016-11-15 09:05:46',NULL),(111,45,'WF Midrange','',1,'2016-11-11 13:44:46','2016-11-18 12:20:03',NULL),(112,82,'5*elements','',0,'2016-11-11 15:17:27','2016-11-11 16:21:24',NULL),(113,148,'Tifa/Tidus/Cloud','',0,'2016-11-11 16:17:07','2016-11-11 18:38:53',NULL),(114,30,'Water and Wind','',0,'2016-11-11 18:59:19','2016-11-11 18:59:19',NULL),(115,139,'Wind/Lightning poke fast! ','haste/unblock deck, poke your opponent quickly and break anything in its way! You\'re hoping to end the game as quickly as possible, and if you\'re forwards are ever in a pinch you\'ve got your damage abilities and removals to chime in.\r\n\r\nYour key forwards are Yuffie (R), Zidane, and both Lightnings, keep them alive to deal damage fast. Majority of your characters will be damage orientated, try to keep a synergy of damage piling on your opponents forwards, and even better if a black mage is on your field!',1,'2016-11-11 19:15:37','2016-11-15 16:41:05',NULL),(116,82,'water and ice dull and draw ','The deck focuses around dulling and freezing your oppenents forwards to allow you to deal them damage, with minwu protecting your cards, and mime and yuna to help you draw more.',1,'2016-11-14 18:09:41','2016-11-14 21:09:03',NULL),(117,51,'Hand Disruption Ice/Water','This is a very heavily focused hand disruption deck.\r\n\r\nThe trick to profit from Sephiroth is to cast him early when you will have an empty hand. \r\nHades is a tech choice for games 2 & 3, if your opponent goes all out and drops a full hand  it allows you to snipe a backup. \r\n\r\nWater is in there to help you recover from an aggressive start and to win out the long game once you have been able to knock 3-4 cards out of your opponents hand (They usually will not let you get many more than that unless they get stuck with something clunky in hand)\r\n\r\nOne down side to this deck is that you can help your opponent shift out dead cards such as multiples/Light&Dark characters.',1,'2016-11-14 18:32:26','2016-11-14 18:32:26',NULL),(118,95,'Cloud 9 Control','I love FF7 and Cloud and really wanted to make a 9 Cloud deck work. This deck takes full advantage of the various versions of Cloud in a control style deck that utterly abuses Cloud (L) and Cloud (S) to the max!\r\n\r\nCloud 9 is a special centric control deck that attempts to clear the opposing threats and have decent match-ups against both aggressive and other control style decks.\r\n\r\nAgainst aggro opponents you are looking for them to over extend. Barret, Red XIII, and Cecil do a great job of blocking and trading for many early threats your opponent can play. 2 drop Barret has the added advantage of trading for 8k with his special. Mid-game against aggro decks and especially the unblockable deck, You can start using your AOE abilities to clear their whole team. This deck often makes aggro decks unable to get through easily on the grown encouraging them to over extend into the various special combos.\r\n\r\nAgainst control opponents you are looking to get 3+ backups in play and to meteorain your opponent\'s threats constantly. In these matchups discard Light Cloud for last for specials because your opponent will remove him at every opportunity.  For added protection the deck includes 2 Titans   to protect Cloud. In the slower matchups you can also create a huge AOE combo with Red XIII + Magus or Barrett for 8000 or 9000 damage AOE. That level of damage clears most threats if they do not have Minwu which is why we include 3 Hecatoncheir. \r\n\r\nIf you love Cloud like I do give this deck a shot. I guarantee you will have a blast!',0,'2016-11-14 19:06:31','2016-11-15 01:58:49',NULL),(119,194,'Standard Units','With the abundance of units labeled \"Standard\" and WoL\'s ability giving them all a significant power boost and First Strike, I thought this would be fun to mess around with. Intended to be more on the \"budget\" side.',1,'2016-11-14 20:57:30','2016-11-14 21:00:11',NULL),(120,188,'Budget FFX Toolbox','FFX Combos for locals\r\n\\Mime for Drawing\\Yuffie to grab easy damage on early-late\r\n\\Easy water summons thanks to Supp Yuna\\\r\n\r\nPD: +2 Archers if in your store Minwu is not banned\\\r\n\r\nby ceres_vx',1,'2016-11-14 21:43:45','2016-11-14 21:51:54',NULL),(121,46,'Mono water','Based around card draw to bring out your best cards and control your opponents.',0,'2016-11-14 22:02:02','2016-11-14 22:02:02',NULL),(122,148,'F/W Midrange Beater','',0,'2016-11-14 22:06:19','2016-11-15 13:41:18',NULL),(123,188,'Budget Gilgamesh','Early Damage with Dragoon and Noel\\\r\nTry to get 129C Brave Gilgamesh first\\\r\nSage to add used Gilgamesh from Break Zone to hand and abuse his special ability\\\r\nDevout to revive Gilgamesh from Break Zone, or summon a Haste Forward to grab last damage\\\r\nMog to add FFXIII Gilgamesh to use others special ability or summon it if you have 4+ points of damage\\\r\nOther Ice cards to stop enemy attacks\\\r\nby ceres_vx',1,'2016-11-14 22:16:41','2016-11-14 22:23:57',NULL),(124,209,'Steam Train','This deck combines the powerful attack of the fire element and the draw of water making...STEAM! Most of the time you shouldn\'t block anything, Just focus on attacking and out powering your opponent, while you replenish your cards faster than the him.\r\n\r\nHave fun!',1,'2016-11-14 22:35:35','2016-11-14 22:35:35',NULL),(125,193,'FE Utility Agro','',0,'2016-11-14 22:53:33','2016-11-18 04:39:31',NULL),(126,211,'Hit & Run  Combo','This deck must be used to quickly win the game and not allow the opponent to withstand more than 6/7 innings.\r\n\r\nIt is to quickly lower forward with haste, to direct direct damage or with yitan and yuffie that enter directly.',1,'2016-11-14 22:57:50','2016-11-14 22:57:50',NULL),(127,210,'Thunderous Tactics!','Featuring a strong foundation in the character of Gilgamesh and his various abilities, and combining that with the shear versatility of Lightning cards, this mono-Lightning control deck has answers for nearly any situation. \r\n\r\nStrengths:\r\n\r\n- Contains a healthy mix of cards that have or grant Haste, Brave and/or First Strike\r\n- Lots of abilities that deal damage to Forwards, which can be combined together\r\n- Gilgamesh\r\n\r\nWeaknesses:\r\n\r\n- No Backup-breaking cards\r\n- Can struggle against beefier Forwards if you aren\'t able to outright Break them\r\n- Almost no EX Burst cards\r\n\r\nStrategies:\r\n\r\nGilgamesh (1-129C)/Orlandeau (1-126H) + Magus/Onion Knight/Black Mage\r\nEven if Strongest Sword is unable to outright Break an opponent\'s Forward, it can be combined with one of these cards to ensure the job gets done. Thunder God Cid can be used as a secondary spark for those same abilities, but he\'s much more costly and much more vulnerable.\r\n\r\nDragoon (1-147C) + Maqui + Party Attack\r\nThere may be times when one of your Forwards by itself can\'t beat an opponent\'s Forward in a straight fight, even if given First Strike via Maqui. Using a party attack with Dragoon involved, and using Maqui on the other party member, gives you a First Strike party that can force its way past near anything.\r\n\r\nZalbaag (1-136C) + Duke Goltanna (1-134R)\r\nOn the face of it, Zalbaag might seem kind of weak for his CP cost and power. (He certainly ain\'t no Dycedarg) However, each color so far has at least one commonly-played 2 CP Forward that together are prime targets for him to slay.\r\n\r\nFire: Warrior of Light (1-005R), Gadot (1-007R), Cloud (1-009C), Tifa (1-016C), Red XIII (1-029C)\r\nIce: Cid Raines (1-192S)\r\nWind: Thief (1-069C), Cid Highwind (1-073C), Y\'shtola (1-084H)\r\nLightning: Rygdea (1-211S)\r\nEarth: Serafie (1-109R), Delita (1-113C), Barret (1-205S)\r\nWater: Gordon (1-160H), Knight (1-165C), Viking (1-167C), Mime (1-173C), Yuna (1-214S)\r\nLight: Onion Knight (1-181H)\r\n\r\nBasically, Zalbaag can make Fire and Water cry a river of tears. And Duke Goltanna lets you search for Zalbaag as needed!',1,'2016-11-14 23:45:29','2016-11-14 23:45:29',NULL),(128,199,'Water/Lightning Control','My take on cloud control',1,'2016-11-15 00:16:55','2016-11-15 00:16:55',NULL),(129,87,'Gabranth\'s Risky Play','Do you like to play dangerously? Then this is the deck for you! \r\n\r\nThe idea of this deck is to purposely damage yourself in order to buff cards such as Gabranth, Dark Knight (Earth) or activate Cecil\'s ability. Set up a nice defensive wall with excellent blockers, and use Ice to freeze your opponent in order to avoid unnecessary damage.\r\n\r\nUse the Dark Knight (Ice) card to your advantage. Break it as many times as you can to accumulate damage. For example Kefka can turn it into a 13,000 power before breaking it, or Delita(3) & Mustadio can break it when entering the field. Use Devout to bring back Dark Knight (Ice) so you can break him again, all behind the safety of your defensive blocker wall. ',1,'2016-11-15 01:37:05','2016-11-15 01:37:05',NULL),(130,89,'Causing Salt with Mill','Its mill\r\nUse Shantotto to punish huge fields\r\nUse valefor to bait them into huge fields\r\nCry softly when you verse aggro.\r\n\r\nKey things I\'m trying to fix.\r\nFit in 3 Prische\r\nGood ways to remove Cid',1,'2016-11-15 02:22:18','2016-11-15 02:22:18',NULL),(131,217,'FIERY TORNADO ','Win fast or build a wall better then Trump',1,'2016-11-15 02:37:41','2016-11-15 02:37:41',NULL),(132,215,'Deck Tech: FFVII Cloud 9 Control','FF VII Cloud 9 Control \r\n\r\nPlease like this deck if you want to see more decks and deck techs in the future.\r\n\r\nHello I am StrategicGamer and welcome to my deck tech on Cloud 9 Control.Let me start by introducing myself. I have played a lot of TCGs over the years and always have played them competitively. I have been a successful deckbuilder and player in Yugioh, Magic, .hack, VS System (the original), and UFS to name a few. It has been awhile since I have played a TCG but I am in love with Final Fantasy, the TCG is fantastic, and I love writing articles so lets get to it. \r\n\r\n\r\nCloud 9 Control first is a control deck. In Final Fantasy, I think a control decks as a deck that wants to generate and win off of card advantage. In the most simplistic case card advantage is generated through the text \"draw a card.\" In Final Fantasy, however, few cards have that text and many of those cards are weak cards like Viking. That means its important for a control deck to discover ways of generating card advantage through means other than card draw.\r\n\r\n\r\nCloud 9 Control tackles the idea of card advantage from two different angles. First, the deck contains the namesake of the deck 9 Clouds. The 4 and 6 drop Cloud can be used to answer your opponents larger characters simply by discarding a Cloud and paying CP to break them outright or to deal them 8000 damage frequently breaking them. The way you come out ahead from using Cloud is to concentrate on your CP sources. I try my best to get 3+ backups in play so I can use  Light Clouds Omnislash without discarding for CP. This also helps maintain additional copies of Cloud in my hand to further abuse His specials by not discarding them for CP. This deck plays slowly. Do not trade damage or you will lose. This deck runs very few EX cards. Make your opponent\'s attacks bad and clear their board before attacking.\r\n\r\n\r\nThis strategy of breaking big characters can run into trouble if your opponent is playing many smaller characters. That leads to the second angle that Cloud 9 attempts to gain card advantage AOE damage. Yes the often ignored Meteorain ability is utilized to its fullest in this list. A run down of the AOE is as follows 6 copies of Barrett and Red XIII for their specials, 2 copies of Biggs and 1 of Wedge to get Biggs, 3 Magus, and 3 Light Cloud.\r\n\r\n\r\nWhen you play against the decks that look to flood the board you often will have the ability to deal massive amounts of damage to their whole team. For example you can have turns where you use Cosmo Memory for 6000 to their team and play a Magus for another 3000 dealing a massive 9000 damage killing all but the largest characters in the game. However another less common scenario that comes up more than I thought it would, is to use Meteorain for 4000 damage and Magus for another 3000 and sacrificing Monk or Black Mage to deal the magic threshold of 8000 damage to their team and in the case of Black Mage taking a larger threat as high as 12000 down also. Getting multiple Grenade Bombs off Barrett is quite common also giving you an additional source of 2000 damage if you fail to draw the other AOE options.\r\n\r\nCard Choices:\r\n\r\n24 Forwards\r\n\r\n\r\n9 Clouds: These are really what makes this deck so flexible. I never play the 2 drop cloud it is merely special fodder for Light Cloud and 6 drop Cloud. These various Clouds give you consistency so against your control opponents you almost always have one.\r\n\r\n\r\n6 Red XIII: I play 2 drop Red XIII against many aggro decks and it shuts them down swiftly. First Strike makes my Black Mages especially potent because I can deal 9000 without losing Red XIII on defense. I don\'t take much advantage of 3 drop Red XIII\'s enter play ability, but it can help 4 drop Cloud push through a point of damage the turn he is played. That said Cosmo Memory is exactly the kind of ability this deck wants. It allows us to set up the huge AOE damage turns discussed above.\r\n\r\n\r\n6 Barrett: Both versions of Barrett are strong in this deck. 2 cost Barrett helps us with our AOE turns and can be used as an early blocker against some of the very fast Lightning decks. The 3 drop can deter attacking as long as he is active because a bad attack can potentially lead to them losing an expensive unit to Hammer Blow and potentially an additional unit to a combination kill from the likes of Black Mage + the 4000 damage from Hammer Blow.\r\n\r\n\r\n2 Cecil: Cecil is extra insurance against the Lightning rush decks as 5000 damage almost all of their haste and units that dull your forwards like Cait Sith 1 drop and Lightning 4 drop. Additionally, Black Mage and Brynhilder can help combo with Cecil to kill larger threats.\r\n\r\n\r\n1 Vincent (5): I run a copy of 5 drop Vincent to have another late game threat in the deck. I want the threat to be a FFVII character so I can reduce the cost of 6 drop Cloud as that can save a few cards and generate additional card advantage. Also Vincent is very hard to block already and combined with Red Mage becomes almost impossible to block. These kind of plays force your opponent, to overextend on the board setting up our phenomenal AOE plays.\r\n\r\n\r\n19 Backups:\r\n\r\n\r\n3 Black Mage (F): I keep talking about this card for a reason this card just does a ton. I advise playing this card in most Fire decks anyway because it allows you to combo with First Strike and other small damage sources to take out large threats for little cost on your side. Best of all its a 2 cost Backup which you actually need to run a lot of I suggest 9 in most decks and you can go higher. To clarify cards like Zangan are really 2 cost because they give you a card back when you play them.\r\n\r\n\r\n3 Red Mage (F): This is a really frustrating Backup. Your opponent has to play multiple units so they can block. This is great for us as it sets up our AOE better. If they don\'t play into our plan, they die instead a nice catch 22 and its a 2 cost. Also as this this deck runs 3 Light Clouds which has Brave, meaning you can often attack without losing a blocker or risking Mustadio killing one of your characters on EX. \r\n\r\n\r\n3 Magus (F): This card deals AOE 3000. This card is ridiculous for a 3 cost Backup. You can play multiple copies on the same turn to stack them and by themselves they kill Yuffie (1) and Zidane. No reason to not run a few of these in ever Fire control deck.\r\n\r\n\r\n3 Monk (E): Monk is not insane but it can prevent your opponent from attacking which is nice. Also, you can sacrifice it to free up room for other supports and to deal damage with Biggs. Monk+Biggs+2 cost Red XIII is an 8000 First Strike Blocker which is often relevant.\r\n\r\n\r\n1 Wedge: Searches for Biggs and is effectively a 2 cost.\r\n\r\n\r\n2 Biggs: Great for getting that last 1000 damage through. It may look weak, but that 1000 damage is frequently critical especially when they are pumping their team by an extra 1000.\r\n\r\n\r\n2 Mustadio: Mustadio has a great ability. Being able to kill most attackers on EX because they usually dull to attack is fantastic. Also, because this deck is slower and will have 3+ backups in play, it is nice to have the additional removal.\r\n\r\n\r\n7 Summons:\r\n\r\n\r\n2 Brynhilder: Deals 7000 and is EX it helps 2 drop Red XIII take out larger buffed attackers and it helps kill larger threats on AOE turns. I don\'t like Brynhilder without additional ways to use the damage like Black Mage because without them it is harder to maintain a board state where getting Brynhilder on EX is beneficial against decks with larger characters.\r\n\r\n\r\n2 Titan: Titan keeps our threats alive. I use it mainly to blank Odin, but it can be used as a combat trick to prevent your blocker from trading also. I am often surprised by the amount of utility this card has for a 2 cost.\r\n\r\n\r\n3 Hecatoncheir: This is mainly used to kill Minwu. If you haven\'t had the thought by now Minwu shuts down the AOE plan of this deck hard! It is  fairly easy to play Hecatoncheir at end of turn, however, and follow up with a big AOE turn as currently nothing diverts Hecatoncheir because it can\'t legally target Yaag Rosch. That said, Light Cloud can take over games despite Minwu so you don\'t get run over necessarily if they have Minwu and you don\'t have Hecatoncheir.\r\n\r\nThanks for reading now go play the strategy. Have fun!',1,'2016-11-15 03:39:18','2016-11-15 03:39:18',NULL),(133,133,'Gilgamesh','',0,'2016-11-15 05:12:10','2016-11-15 05:12:10',NULL),(134,218,'rainbow good stuff','This is a test deck i\'ll proxy up sometime this week and give an update on performance. \r\n\r\nThe idea is to abuse rainbow producing colors to get some of the better cards in each color. Being able to produce all colors on certain  backups is great we just need enough of an earth core to play those cards.\r\nOur base is earth/water this gives us card draw and card filtering to find our multi color backups.\r\n\r\nForwards: I tryed to choose efficient  forwards that either slow the game down or are hard to deal with. We try to use gabranth and blitz ace as our main wincons as we will take alot of damage early trying to setup we really benefit from their effects.\r\n\r\nBackups: This is were we are most shaky our cp base is pretty fragile to removal and forced me to include auron and yaag to help mitigate that. We have a few filtering backups to get us what we need and The lightning backups help us buyback our better forwards or cheat them into play if our cp is not right. When i need to make changes this is where i will start.\r\n\r\nSummons: This is where we get a bit toolkit like, Moogle is at 3 for the filtering and we have some decent ex bursts to catch our opponent off guard. Numbers hear may need to be changed around a bit to see what fits best.',1,'2016-11-15 05:16:41','2016-11-15 05:16:41',NULL),(135,216,'Deck that does nothing!','Pretty much just chucked together some cards that i thought looked pretty dank. Plus Lightning is my waifu so i had to make a deck around her. This deck may not win you games but it will win your heart. (:',1,'2016-11-15 05:20:05','2016-11-15 05:20:05',NULL),(136,133,'Budget Gilgamesh','',0,'2016-11-15 08:11:32','2016-11-15 08:11:32',NULL),(137,222,'Water/Ice','Dulling/freeze/discard control.\r\n\r\nAttempt at a deck with what i had from starters/some packs , seems to work nicely.\r\n\r\nComments/suggestions welcome!',1,'2016-11-15 09:01:47','2016-11-15 09:01:47',NULL),(138,69,'Cloud/Tidus','',0,'2016-11-15 12:02:37','2016-11-15 12:02:37',NULL),(139,224,'FFX Water/Wind','The deck is combo and synergy heavy.\r\n\r\nI\'m not running Yaag Rosch because I want my backups to be Minwu, Yuna, Maria, Aerith and Chaos. I run three of each Yuna/Minwu so if one is broken I can just replay it. There is a lot of cycle in Water, and you\'ll be amazed how quickly Moogle runs through your deck.\r\n\r\nI\'m trying out Sephiroth, but I\'m not sold on him.\r\n\r\nPossible Changes would be\r\n\r\n-1 Geomancer 169\r\n-1 Sephiroth 186\r\n+2 Yaag Rosch/+1 Yaag Rosch & +1 Cecil 162',1,'2016-11-15 12:35:32','2016-11-15 20:38:28',NULL),(140,224,'FFVII Fire/Earth','',1,'2016-11-15 12:38:08','2016-11-15 12:39:09',NULL),(141,148,'Best F/W Deck - Must See!','A consistent midrange beater deck abusing Waterkick and Omnislash to secure the win!',1,'2016-11-15 13:48:00','2016-11-15 13:48:00',NULL),(142,224,'Control Lightning/Earth','',1,'2016-11-15 14:58:31','2016-11-15 15:04:49',NULL),(143,224,'Water/Wind Party Aggro','This deck is built around getting multiple cheap forwards on the board and powering them up. You can also benefit from strong party attacks with additional effects.\r\n\r\nForwards\r\n\r\nZidane - Is very strong by himself. Can\'t be blocked be 4CP or higher and can\'t be targeted. Great card!\r\n\r\nWarrior of Light - The whole reason this deck is a power house. His ability effects every forward in the deck except Zidane and Cecil. +2000 and First Strike is very relevant. \r\n\r\nCecil - Has one job, keep Warrior of Light alive, simple.\r\n\r\nBartz - We are all unemployed because Bartz has ALL the jobs. his 8000 base is pumped to 10,000 with First Strike thanks to Warrior of Light. There isn\'t much that can trade favourably with him once he is buffed and again Cecil even keeps him nice and safe. \r\n\r\nChocobo\'s - The 1 and 3 CP Chocobo\'s benefit from party attacks as they give +2000/+3000 to all units in the party respectively. \r\n\r\nKnight - A solid 2CP drop that can protect another Water unit in party attacks.\r\n\r\nMime - Loves a good party, and can party with Either Wind or Water Forwards, plus you get to draw a card!\r\n\r\nBackups\r\n\r\nAerith - Fantastic CP ramp when you already have three backups out. Planet Protector keeps Warrior of Light save until you can get Cecil on the board.\r\n\r\nMaria - Why be satisfied from only Warrior of Light buffing your Forwards? Another +1000 across the board helps hit those magic numbers.\r\n\r\nArcher - Backup removal is very strong, slows your opponents momentum and removes a pesky enemy backup.\r\n\r\nMinwu - Arguably the best backup in Water or the game. Make Fire cri evertim as thier summons and combo damage does nothing to your buffed Forwards.\r\n\r\nYaag Rosch - Much like Cecil, Yaag\'s job is to keep Aerith and Minwu on the board. Plus it\'s nice to have another 2CP backup early game.\r\n\r\nYuna - 9 0f the 11 Summons are Water, 6 of the 11 can be reduced. No brainer.\r\n\r\nCosmos - Colour fixing at its best.\r\n\r\nSummons\r\n\r\nAlexander - You won\'t come across many 5CP+ forwards, but it\'s good to have ways to deal with large Forwards without losing your own during party attacks.\r\n\r\nFairy - Deck cycling in an aggro deck is essential and being able to active a dulled and potential frozen Forward is nice utility. \r\n\r\nMoogle - Premium deck cycling, so good it was banned in Japan!\r\n\r\nLeviathan - FFTCG\'s Sap (Hearthstone) or Unsummon (MTG), destroy your opponents tempo or remove a nasty threat prior to attacking. \r\n\r\nMulligan\r\n\r\nYou really need to get Warrior of Light down as he is the linch pin of the deck, but be wary of your match up and potential removal from your opponent. 3CP Chocobo is great for early haste damage pressure. Never discard Aerith for CP and once you have Forwards on the board try to avoid dulling Aerith (even if you don\'t have another copy in your hand) to try and prevent your opponents removal. \r\n\r\nHave fun!',1,'2016-11-15 15:11:20','2016-11-15 21:19:43',NULL),(144,212,'Starter Set - Final Fantasy VII (Fire & Earth)','Starter Set - Final Fantasy VII (Fire & Earth).',0,'2016-11-15 15:11:53','2016-11-16 08:49:20',NULL),(145,228,'XIII Starter = Adjusted','I cut some cards that were not giving me much on curve while playing against an edited VII and edited X deck. That FFX deck is tough.\r\n\r\nAdded 1 Orlandeau, 1 Golbez (fetches up Cid and Ryg), Nooj, Sephiroth for discard pressure, and added the 1 cost Ramuh for some quicker lower costed removal.',1,'2016-11-15 15:29:14','2016-11-15 16:37:43',NULL),(146,226,'Dodge, destroy and Hit - L/E/W','Competitive Earth and Lightning deck. With a splash of wind.\r\n\r\nThis deck is focus in destroy your problematic opponents forward.\r\n For that you have summons and backups that allow you to destroy them instantly.\r\nAlso you count with cards like Monk and Golem to make you forward go victorious from some situasions.\r\n\r\nAfter that you can make a clear path for your forwards to go through. Or, just go with Zidane.\r\n\r\nIf you like, Show it  :)',0,'2016-11-15 16:11:07','2016-11-18 16:13:50',NULL),(147,169,'Control','test',0,'2016-11-15 17:04:02','2016-11-15 17:04:02',NULL),(148,128,'testbuild','',1,'2016-11-15 17:14:05','2016-11-15 17:14:20',NULL),(149,228,'Renewable Energy  (Wind)','So this is intended to be a fast deck. \r\n\r\nDeck strengths and points of interest:\r\n\r\nVaan - gets more forwards onto the field quicker, and opens up backups as well. You can dump your hand in some situations really fast. (Chocobo, Yuffie, Archer, Zidane).  \r\n\r\nOnion Knight - He can play himself! (and if he can be reactivated via Aerith or some other means then you got a combo going.   \r\n\r\nYuffie - Unblockable goodness - and the 2 drop version can be played for free using Vaan.\r\n\r\nZidane - One of the best Wind forwards, and he fits right in to what\'s going on here.   \r\n\r\nValefor - Here for those games when you just are losing advantage and need a reset. With cards like Vaan you can rebuild your board quickly.  \r\n\r\nBartz is one of the higher costed cards, but he lets you swing out with your Wind forwards and activate them for blocking.   \r\n\r\nDevout - If you have needed to block and lose some lower costed forwards, well devout can help you get them back!    \r\n',1,'2016-11-15 17:27:27','2016-11-15 17:42:21',NULL),(150,230,'CoD Control','A very fun control/combo deck based around Cloud of darkness synergies. The whipe from CoD becomes almost one sided with emperor, geomancer(3), and yuna/tidus. Deck seems to be doing very well. Any thoughts or questions just comment.\r\n\r\nCecil is kinda a flex spot. Any ideas what might be better in that position let me know',1,'2016-11-15 17:29:45','2016-11-15 17:29:45',NULL),(151,169,'Tempo','test',0,'2016-11-15 17:32:27','2016-11-15 17:32:27',NULL),(152,233,'Altered FF13','Gilgamesh boosted starter set',0,'2016-11-15 18:11:15','2016-11-15 18:11:15',NULL),(153,233,'Altered FF7','Starter set boosted with best F/E cards',0,'2016-11-15 18:15:48','2016-11-15 18:15:48',NULL),(154,228,'Hand Freeze (Ice/Water)','The goal of this deck is to keep the opponents hand empty using Ice\'s forwards with discard \"ETF\" (Enter the field) effects. Supplementing this deck is the Water element for card draw and backup mana.\r\n\r\nSuggestions welcome.',1,'2016-11-15 18:29:37','2016-11-15 18:35:47',NULL),(155,68,'Tidus Combo','My midrange version of the Tidus combo deck. This deck incorporates the power of the YRP Tidus combo with the ability to protect it\'s combo pieces from destruction. I am opting to play Yuffie which a bit more suspecible to removal than Zidane but it\'s a lot more budget friendly and can be protected by Cecil and Aerith.\r\n\r\nI\'ve opted to not to use Sephiroth as Archer does the job better. The Geomancer forward is your early protection regarding aggro and will give you an extra card to set up next turn.\r\n\r\nI have opted only to use 1 Blitz Ace Tidus, the reason behind this is I feel it only truly useful as a late game card and you would be better off playing Wakka in the mid game and play Tidus as a finisher.\r\n\r\nThe singleton Geomancer in the backup list serves to correct your draws and rig an ex burst upon your opponent\'s attack.\r\n\r\nGive it a go and have fun!',1,'2016-11-15 19:17:20','2016-11-15 19:17:20',NULL),(156,234,'Renewable EX-Power','Quick Deck - Powerful and with nearly 50% of EX cards, massive chance to destroy your enemy even when receiving damage.\r\n\r\nTested.',1,'2016-11-15 19:50:40','2016-11-15 19:50:40',NULL),(157,107,'Control cloud','',0,'2016-11-15 21:05:01','2016-11-15 21:05:01',NULL),(158,236,'Water/Lightning Control','',0,'2016-11-15 23:13:04','2016-11-15 23:13:04',NULL),(159,237,'Water/Wind X','Feedback wanted.\r\n\r\nIm not a very experienced TCG player, but this is a deck i have thrown together for TCG night at my Local FLGS.\r\n\r\nThoughts:\r\nStandard Y+P+R+T (Charlie\'s Angels?) combo.\r\nParty attack with Wakka + Knight.\r\n\r\nI would like to have 3 Maria and 3 Minwu, but i dont have 3 of each yet.',1,'2016-11-16 00:35:45','2016-11-16 09:00:42',NULL),(160,239,'ice/thunder','',0,'2016-11-16 01:22:49','2016-11-16 01:22:49',NULL),(161,48,'Stasis Proto','control blue',0,'2016-11-16 01:27:39','2016-11-16 01:27:39',NULL),(162,240,'Current WW combo deck','',0,'2016-11-16 01:38:36','2016-11-16 01:38:36',NULL),(163,240,'WW combo deck','There\'s three combos in this deck:\r\nZidane & Yuffie for sneeky damage\r\nRYP - Yuna Rikku Paine\r\nTidus to finish it off if you fall too much behind\r\n\r\nGenerally speaking I like to have options and this decks provides us with 3 different avenues to win the game.\r\n\r\nIf your opponent is burning the low ground (F&E) discard the Zidane and Yuffie to produce CPs for Tidus and RYP.\r\n\r\nAlexander 