 darkness/sage/yuj seems pretty good the rest is a control is shell to keep early aggro at bay',1,'2016-11-16 03:25:28','2016-11-16 03:25:28',NULL),(176,240,'Too fast too furious','with this deck you should be able to hit the ground running with lots of hasty quick creatures and then heavy removal to get rid of big threads.\r\n\r\nthere is only 1 strategy with this deck and you need to be rushing or you\'re done.\r\n\r\nThe emperor is only in there to help stabilize the board.',1,'2016-11-16 03:28:40','2016-11-16 03:28:40',NULL),(177,247,'Cloud Control','The aim is simple - Get to Cloud L and keep killing your opponent\'s minions while poking for damage. Jessie and Serafie make sure you always have Clouds to discard.\r\n\r\n18 EX means taking damage often gives you advantage, especially because the 6 searchers & 3 Mustadio will always be live and Cecil makes sure even Ifrit gets value off the burst.',1,'2016-11-16 04:47:21','2016-11-16 04:47:21',NULL),(178,248,'Control brew','Water & Ice brew',1,'2016-11-16 05:45:45','2016-11-16 05:45:45',NULL),(179,253,'Frozen Rain','Fast control deck.  Focuses on early aggro with cheap lockdown.  ',0,'2016-11-16 07:16:34','2016-11-16 07:16:34',NULL),(180,244,'Earth/Water - Control ','The other emperor list I\'m working on, trying to find the right home for him, I\'ve wanted to test Prishe for a while too so this works for that too.',1,'2016-11-16 07:30:09','2016-11-16 07:30:09',NULL),(181,197,'Onion Knight Beatdown','After playing vs all the starter decks I realized Purple/Green is more my playstyle so I decided to make this deck. Gilgamesh is dumb. Lightning is dumb. Onion Knight is the best!',1,'2016-11-16 08:10:03','2016-11-16 08:20:35',NULL),(182,212,'Gilgamesh (Lightning & Water)','Gilgamesh (Lightning & Water).',0,'2016-11-16 09:13:54','2016-11-16 09:13:54',NULL),(183,224,'FFX Water/Wind Ver. 1.2','',1,'2016-11-16 09:24:22','2016-11-16 09:24:22',NULL),(184,212,'Frozen water (Ice & Water)','Frozen water (Ice & Water).',0,'201