lp from emperor and devout to get more stuff on to the bord then my opponent after a CoD\r\n\r\nand the best thing about this deck is you dont have to be scard off Minwu when your wincon is not affected by him at all',1,'2016-11-16 20:53:13','2016-11-16 20:57:14',NULL),(210,271,'Who killd the Golbez','this deck is all about geting cheep damage from haste then get golbez out and thret to get more guys out to finish the game \r\n\r\nyou can ahive this in many ways becus you can to som shananigans mid combat by the help of Tamma, \r\n\r\nfor exampel you can bounch in Delita or Muatadio after Golbez ben attacking, you can bounch in a 4 cost lightning or cait Shith to tap the last standing forword. you have Serafie and sage to reuse your tools in the deck.\r\n\r\ntry it  its a lot of fun',1,'2016-11-16 21:14:53','2016-11-16 21:17:34',NULL),(211,275,'The Emperor\'s New Groove','Surprisingly an effective little deck that I\'ve been working on. It focuses on cycling through your deck and bouncing your opponent\'s stuff until you can play The Emperor with the Gullwings as support and Cloud of Darkness to trigger his destruction effect in a moment you need to. Yuj being in the deck to put any Emperors you draw back in the deck and bouncing your own cards to play them again to keep getting draws off.',1,'2016-11-16 22:10:27','2016-11-16 22:10:27',NULL),(212,10,'Fire/Earth','',0,'2016-11-16 22:16:58','2016-11-16 22:16:58',NULL),(213,275,'Dishin\' out the Dirt','My mono-earth deck. Focuses on playing defensively until you can go for the big swing for game. Honestly plays really well by itself and seems to handle itself nicely. Overall it\'s a personal favorite too.',1,'2016-11-16 22:25:29','2016-11-16 22:25:29',NULL),(214,276,'FF7 Fire/Wind ','This deck is more focused on Cloud and Tifa and also Yuffie as they can all deal some well rounded out damage from abilities. \r\n\r\nLann is a great option for this deck as well making your opponent block with weaker attacker\'s or having