deck. I didn\'t get his effect off at all in any of my games, but running him as a 1 of as a 5 cost 9k i thought was pretty decent, as one of my good friends D\'marcus Williams, the former Cardfight Vanguard pro player, had found that in this current \'meta\' the 7k and 9k are your \'magic numbers\'. Im considering possibly swapping Exdeath out but at this moment of time ill need to play test him some more. Anyways on to my deck list!\r\n\r\n',1,'2016-11-18 12:55:45','2016-11-18 13:03:40',NULL),(281,89,'Cait Sith Control','Cait Sith is a good card, he beats a lot of aggro cards. \r\n\r\nI won locals with this deck and a bit of luck. I want to fit Minwu in but I don\'t think it\'s really needed.\r\n\r\nMatches played\r\nRound 1 - Random deck (2-0)\r\nRound 2 - Lightning Aggro (2-0)\r\nRound 3 - Golbez Beat (2-1)\r\nRound 4 - Fire/Earth Aggro (1-1 draw) (Time was called)\r\n\r\n',1,'2016-11-18 13:02:05','2016-11-18 14:27:47',NULL),(282,326,'Yuna','Yuna draw Tidius\r\nSide : viking',1,'2016-11-18 13:19:22','2016-11-18 15:27:56',NULL),(283,326,'Squall // Laguna splash U','',1,'2016-11-18 13:28:27','2016-11-18 15:02:49',NULL),(284,326,'Gruul aggro test','',0,'2016-11-18 13:37:11','2016-11-18 13:37:11',NULL),(285,294,'Focus','',0,'2016-11-18 13:48:15','2016-11-18 13:48:15',NULL),(286,326,'Lightning Gilgamesh Kimahri control','',1,'2016-11-18 13:49:53','2016-11-18 15:02:25',NULL),(287,326,'Snow Laguna','',1,'2016-11-18 13:54:09','2016-11-18 15:02:07',NULL),(288,326,'Unblockable','',1,'2016-11-18 14:47:46','2016-11-18 15:01:59',NULL),(289,326,'Cloud','',1,'2016-11-18 14:53:18','2016-11-18 15:01:50',NULL),(290,329,'Ice/fire tempo','Dull forwards and attack is basically the idea. ;)',1,'2016-11-18 14:57:04','2016-11-18 14:57:04',NULL),(291,326,'Lightning Squall Laguna','',1,'2016-11-18 15:01:33','2016-11-18 15:01:42',NULL),(292,289,'Lighting Control','',1,'2016-11-18 16:42:05','2016-11-18 16:42:05',NULL),(293,302,'Water/lightning/earth standard units','Heavy offence is the main aim of this deck, using the warrior of light to buff you standard units so you can attack safely with first strike.\r\n\r\nDragoons are good in your early game befoe you get warrior of light into play earning you valuable damage in the beginning and forcing your opponents to go defensive. Goemancers are strong additions with warrior of light in play letting you draw a card if Thier taken out.\r\n\r\nLeviathan can be used to return bulky blockers to your opponents hand so you can keep the pressure up while fairy allows you to activate a unit on Thier turn to defend with and draw an extra card. Odin allows you to further keep the pressure on by breaking Thier units.\r\n\r\nYour red mages allow you to further your early game by enabling your units to act faster, while Kefka lets you buff them to take out those strong blockers. Once buffed with warrior of light, minwu makes removing your forwards incredibly difficult, coupled with the first strike your standard units have.\r\n',1,'2016-11-18 16:45:23','2016-11-18 16:45:23',NULL),(294,302,'Tactics','',0,'2016-11-18 17:01:32','2016-11-18 17:01:32',NULL),(295,309,'Ice/water Discard','',0,'2016-11-18 17:08:13','2016-11-18 17:08:13',NULL),(296,224,'Ice/Lightning Dull Control','This deck is designed to lock your opponent out with Dull and Freeze effects and go in for the kill with powerful Forwards.\r\n\r\nForwards\r\n\r\nSquall - Is the perfect anti-aggro Forward as you can often 2-for-1 on defensive trades. Renzokuken allows him to trade up against big threats, but can\'t be relied upon due to there only being three Squall\'s in the deck.\r\n\r\nSnow\r\n\r\nSo good at keeping big threats Dulled upon attack and even Frozen when a Shiva is played in the same turn. Snow also increases the chance of Jihl Nabaat to Freeze two Forwards.\r\n\r\nTerra - I wanted at least four Terra, but am not sold on the 4CP version. This is here as Special fodder. The 3CP Terra messes with your opponent\'s CP calculations with Summons and can often catch them out with her Special, pumping her up to 9000 Power and First Strike.\r\n\r\nLaguna - The EX BURST is handy when played in combination with Snow of Jihl Nabaat. It\'s disgusting if you have Squall on the field. Not only will it Freeze, but you gain a 9ooo Power beater.\r\n\r\nThe Emperor - You are basically paying 5CP for 27,000 Power. As long as you don\'t draw a  second one, it is massive value!\r\n\r\nLightning - The 4CP is very aggressive and plays into our control game by Dulling a Forward, which we could possibly Freeze by playing Jihl Nabaat, or at the very least it prevents a troublesome blocker. The 6CP version nets us some hard removal, gives us a solid 9000 Power body on the board and then the Special also removes a threat. There is a lot of utility in these two cards.\r\n\r\nKuja - Solid 9000 Power body that is super sticky, as it requires an extra discard when targeted. \r\n\r\nBackups\r\n\r\nJihl Nabaat -  The EX BURST is insane as it can take two Forwards out of the game for a couple turns. Her Special allows for even more control. All that on a 2CP card! \r\n\r\nChemist - Another way to Dull a pesky Forward to allow your Forward to attack unblocked. \r\n\r\nSage - Expensive at 4CP, but allows us to re-use Specials or get back a much needed forward to be replayed. Lulu loves breaking Sage after it\'s job has been done.\r\n\r\nLulu - Mainly used in combination with either 1CP Shiva or Ramuh to deal 10,000 to a Dull/Active forward. The Special does the same thing, but without Breaking another backup. Either way it is still a two-card combo.\r\n\r\nDevout - Can target 16 of the 24 Forward cards in the deck, but mainly used to get Squall back after he has been broken.\r\n\r\nRed Mage - With all this control but Dull/Freeze it\'s good to have some more aggression, allowing you to give any Forward Haste for the turn.\r\n\r\nChaos - Colour fixing.\r\n\r\nSummons\r\n\r\nShiva - 2 of the 1CP and 3 of the 3CP. The 1CP is used alongside Lulu to Break a Dulled threat or Snow to keep it locked out. The 3CP Shiva is just fantastic on it\'s own both offensively and defensively. \r\n\r\nOdin - Target removal for anything 4CP or less. Only need two as Lightning searches for a copy upon being played.\r\n\r\nRamuh - Can Break a pesky chump blocker before combat, or used in combo with Lulu to Break a larger threat.\r\n',1,'2016-11-18 17:50:25','2016-11-18 17:50:25',NULL),(297,123,'Control','',0,'2016-11-18 17:58:35','2016-11-18 17:58:35',NULL),(298,119,'High Pressure System','',0,'2016-11-18 18:57:13','2016-11-18 18:57:13',NULL),(299,302,'Pure windmill','Very simple deck, reduce your opponents deck to 0 using thieves, cid and rikku. Use hope, Alexander bartz and aerith to activate your backups and forwards so you can continue the windmill',1,'2016-11-18 19:17:36','2016-11-18 19:17:57',NULL),(300,10,'','',0,'2016-11-18 20:07:45','2016-11-18 20:07:45',NULL),(301,30,'Ice','',0,'2016-11-18 20:18:28','2016-11-18 20:18:28',NULL),(302,30,'','',0,'2016-11-18 20:25:01','2016-11-18 20:25:01',NULL),(303,30,'Earth and Fire','',0,'2016-11-18 20:39:29','2016-11-18 20:39:45',NULL),(304,292,'CoD Breaker','A control deck that focuses on heavy bodies, removal, and benefiting off of your Forwards Breaking. The namesake is derived from the card Cataclysm in Magic that works similar to our main card: Cloud of Darkness. Play her, save a big body, and trigger all your Break abilities to have an overwhelming advantage post board wipe.  ',1,'2016-11-18 21:41:58','2016-11-18 22:17:06',NULL),(305,251,'Death Knight','',1,'2016-11-18 21:51:40','2016-11-18 23:05:27',NULL),(306,333,'Time Compression - Sorceress\' Knights','',0,'2016-11-18 22:05:32','2016-11-18 22:05:32',NULL),(307,334,'Party Time','',0,'2016-11-18 22:36:00','2016-11-18 22:36:00',NULL),(308,332,'When Villains Die','Rough draft for a fun deck, doubt its good enough for the current meta.',1,'2016-11-18 23:09:11','2016-11-18 23:18:51',NULL);
