INSERT INTO `messages` VALUES (1,1,1,'Feel free to ignore this, just testing the messaging system out :)','2016-11-09 01:55:03','2016-11-09 01:55:03'),(2,1,1,'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean pellentesque nisl leo, in volutpat mauris venenatis quis. Phasellus hendrerit lectus non justo tempus, quis ultrices nisi iaculis. Phasellus est elit, mattis id euismod vitae, iaculis consectetur arcu. Integer at nibh at lorem volutpat placerat eget quis magna. Sed mollis vestibulum vestibulum. Morbi volutpat vestibulum ante vitae bibendum. Phasellus sit amet gravida massa.\r\n\r\nDuis a metus nisl. Nunc ut maximus nisl. Ut faucibus, orci eu ullamcorper ullamcorper, justo turpis fermentum lacus, ac luctus dolor mauris a urna. Integer rutrum mi a odio pellentesque hendrerit. Vestibulum nec ultricies orci. Praesent elementum, nunc quis tempus commodo, dolor ante vulputate turpis, vitae tincidunt felis nisi ac eros. Pellentesque nec quam nec ex viverra hendrerit.','2016-11-09 02:08:27','2016-11-09 02:08:27'),(3,1,74,'DONT CONTACT THIS NUMBER AGAIN','2016-11-09 10:26:58','2016-11-09 10:26:58'),(4,2,133,'Hi, if this isn\'t the Dan that is running the site, I apologize. Even after logging in I can\'t make decks nor see my saved decks. All I see when I click on Your Decks looks like Public Decks. Hoping it gets fixed soon so I can get back to brainstorming deck ideas. Great site so far, keep up the good work.','2016-11-13 18:38:54','2016-11-13 18:38:54'),(5,2,1,'Hey,\r\n\r\nThanks for bringing that to my attention - I had a shuffle around of some elements based on how people were using the site, and accidentally made some changes which meant the public deck list overrode \"your decks\". That should be fixed now, really sorry!!','2016-11-14 17:06:52','2016-11-14 17:06:52'),(6,3,29,'Hi Dan,\r\n\r\nFirst of all, many thanks for this web, is being really useful. I found the following, hope it helps:\r\n\r\n- \"Can\'t make decks.\" message is supposed to be received just by you (I guess Spicytuna sent only to you), but I received it as well.\r\n- Edit button in \"Your decks\" section is driving to a \"page not found\" message.\r\n- I tried to navigate to http://fftcgdb.com/u/Rinflis (even not logged-in) just to check what others can see and is forwarding me to an \"error\" message.\r\n\r\nThanks a lot for your hard work !','2016-11-14 17:35:51','2016-11-14 17:35:51'),(7,3,1,'Hey,\r\n\r\nDid you get a notification icon in the top? Or did it just appear in your messages list? It shouldn\'t appear in the messages list now anymore, but I\'m not sure how it determines the notification piece. Its my own fault, I used a third-party solution for messages as I thought it would be more stable than me creating one from scratch. Looks like I\'ll have to revise this possibly and create something around it to make it work better...\r\n\r\nThe deck creation should be sorted now, thanks. Was an issue with changing how the \"public decks\" piece shows up for users.\r\n\r\nAs for the public link, you should actually be using \"http://fftcgdb.com/u/Stiros\" which is your username, as opposed to your \'name\' which is just a way of addressing the user on the system. I will add a \"Public profile\" link someplace, do you have any suggestion as to where it might go?\r\n\r\nThanks again, feedback really helps :)','2016-11-14 18:00:57','2016-11-14 18:00:57'),(8,3,29,'Huh, fast as hell.\r\n\r\nThanks to you, not to me, I\'m just using your development :)\r\n\r\nI get a notification now with your answer, but no with the other message. I can\'t see the other messages now, so it seems everything is working as expected.\r\n\r\n\"Edit\" button in decks is now working as well.\r\n\r\nRegarding the public link, what about just a \"link\" box in \"Your collection\"? something like LinkedIn is having under your profile pic. That way, all the people will be able just to copy/paste the link.\r\n\r\nMy fault, as I see \"Rinflis\" in the menu, I guessed I should use \"Rinflis\" as link. With http://fftcgdb.com/u/Stiros is working perfectly. Maybe showing the username even in the menu and there could help to avoid confusions.\r\n\r\nAs suggestion, take a rest ! ! ! ! You are putting a huge effort here :)','2016-11-14 18:26:32','2016-11-14 18:26:32'),(9,3,29,'Just published this webpage in the Spanish FF TCG Community in Facebook (if you are thinking on translation, I can help, but with no rush, I\'m really busy :P ), as well as in my own local group. Hope it helps !','2016-11-14 19:55:00','2016-11-14 19:55:00'),(10,3,1,'Hey\r\n\r\nNo worries - glad I\'ve been able to tackle most of the issues! I\'ll add in a public link box in \"Your Collection\", its a good place to put it, thanks for that :)\r\n\r\nGreat about the Spanish site, thanks! I\'m planning on implementing translations after the comment and trading stuff. so it\'ll be coming fairly soon I imagine. When it does I\'ll make an announcement as such :)\r\n\r\nThanks again, every little helps! :D','2016-11-14 23:04:21','2016-11-14 23:04:21'),(11,2,133,'Thanks for the reply! Enjoying the site and thanks for the work!','2016-11-14 23:11:50','2016-11-14 23:11:50'),(12,4,1,'Hey,\r\n\r\nJust wanted to apologise for the comments error you had earlier - had moved some stuff around which apparently had broken it! Should be sorted now. Apologies again!\r\n\r\nD','2016-11-15 20:50:45','2016-11-15 20:50:45'),(13,5,1,'Hey,\r\n\r\nJust wanted to apologise for the comments error you had earlier - had moved some stuff around which apparently had broken it! Should be sorted now. Apologies again!\r\n\r\nD','2016-11-15 20:51:10','2016-11-15 20:51:10'),(14,4,224,'All good man!\r\n\r\nlove the site!','2016-11-15 21:15:28','2016-11-15 21:15:28'),(15,6,212,'Hello, dan ... In my personal profile do not see the foils cards that I have added to my collection ... How do I solve this problem? To the rest of the users if they are seen ... Forgive my English, I am Spanish. A greeting.','2016-11-16 01:48:46','2016-11-16 01:48:46'),(16,7,1,'Hey,\r\n\r\nSaw the errors come through when you tried to add a comment, apologies. I hope I\'ve fixed that error now, so it shouldn\'t happen again.\r\n\r\nSorry again!\r\n\r\nDan','2016-11-16 12:00:36','2016-11-16 12:00:36'),(17,6,1,'Hi Juan,\r\n\r\nHave you updated the second column in the collection table? Does it not save? Looking at your profile here http://fftcgdb.com/u/Juan%20Pu%C3%B1ias I can\'t see any marked as being foil. Could you send me a screenshot perhaps?\r\n\r\nThanks,\r\n\r\nDan','2016-11-16 14:13:39','2016-11-16 14:13:39'),(18,6,212,'Hi, dan... Yes, I completed the second column of the collection so I can include the cards I have in foil version. I just checked it and saved it again. Here I leave you an image ... I hope it can be solved: https://postimg.org/image/lwr429jst/','2016-11-16 21:04:57','2016-11-16 21:04:57');
